import React from "react";
import './nav_bar.css';
import CV from './Regi_Loshi_CV.pdf';
const NavBar = () => {
    return(
        <nav>
            <ul className=""animate__animated animate__>
                <li className="Options grow">About me</li>
                <li className="Options grow">Projects</li>
                <li className="Options grow"> <a href={CV} download='Regi_Loshi_CV'>CV </a></li>
                <li  className="Contact grow"> <a href='mailto:regi@regiloshi.com'>Contact me </a></li>
            </ul>
        </nav>
    )
}
export default NavBar;
